import { useEffect, useState } from 'react';



function App() {

  const [counter, setCounter] = useState(0)
  const [counter2, setCounter2] = useState(0)
  useEffect(() => {
    console.log('counter tiene el valor de:', counter)
  }, [counter])

  const handleOnclick = () => setCounter(prev => prev + 1)

  const handleOnclick2 = () => setCounter2(prev => prev + 1)

  return (
    <div>
      <button onClick={handleOnclick}>
         counter {counter}
      </button>
      <button onClick={handleOnclick2}>
      counter2 {counter2}
      </button>
    </div>
  );
}

export default App;
